  const params=useParams()
  const gettemplate=()=>{
    switch(params.id)
    {
      case '1':{
        return <Template1 /> 
    }
    case '2':{
      return <Template2 /> 
  }
  }
}
  return (
    <DefaultLayout>

   {gettemplate()}
    </DefaultLayout>
  )
}

export default Templates
